*{
  margin:0;
  padding: 0;
  box-sizing: border-box;
}
@font-face {
  font-family: "iconfont"; /* Project id 2920130 */
  src: url('//at.alicdn.com/t/font_2920130_8f4ceab8imx.woff2?t=1636252792434') format('woff2'),
       url('//at.alicdn.com/t/font_2920130_8f4ceab8imx.woff?t=1636252792434') format('woff'),
       url('//at.alicdn.com/t/font_2920130_8f4ceab8imx.ttf?t=1636252792434') format('truetype');
}

.iconfont {
  font-family: "iconfont" !important;
  font-size: 16px;
  font-style: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

.icon-shousuo:before {
  content: "\e81f";
}

.icon-quanping:before {
  content: "\e600";
}
// 去掉百度地图左下角水印的两个样式
/deep/.BMap_cpyCtrl {
    display: none!important;
}
/deep/.anchorBL {
    display: none!important;
}
//全屏样式定义
.fullScreen{
  position: fixed !important;
  top: 47px !important;
  width: 91% !important;
  height: 93% !important;
  margin: 0 !important;
  left: 50% !important;
  transform:translate(-50%,0%) !important;
  z-index: 999;
}

.container{
  position: fixed!important;
  top: 0 !important;
  left: 0 !important;
  width: 100% !important;
  height: 92% !important;
  margin: 0 !important;
  z-index: 100;

}
.header{
  height: 50px;
  width: 100%;
  background-color: #fff;
  border-bottom: 1px solid rgb(180, 180, 180);
}
.logo{
  height: 50px;
  width: 10%;
  top: 0;
  left: 2%;
  line-height: 50px;
  position:absolute;
}
.logoImg{
  margin-left:20%;
  height: 48px;
  width: 100px;
}
.title{
  height: 50px;
  position:absolute;
  top: 0;
  left: 50%;
  text-align: center;
  transform:translate(-50%,0%);
  width: 200px;
  line-height: 60px;
  font-size: 24px;
  top: 0;
  color: rgb(161, 161, 161);
}
.timeShow{
  height: 50px;
  right: 10%;
  line-height: 50px;
  top: 0;
  position:absolute;
}
.mainContainer{
  width: 100%;
  height: 100%;
}
.main{
  width: 90%;
  margin: auto;
  height: 100%;
  display: flex;
  flex-wrap: wrap;
  position:relative
}
.mapEchartBox ,.deatileMessageBox ,.sensorSearchBox ,.dataEchartBox{
  padding: 3px;
  flex: 50%;
  display: inline-block;
  min-height: 50%;
  position: relative;
}
.mapEchart{
  border: 1px solid rgb(192, 192, 192);
  background-color: #fff;
  width: 100%;
  height: 100%;
  display: inline-block;
}
.deatileMessage{
  border: 1px solid rgb(192, 192, 192);
  background-color: #fff;
  width: 100%;
  height: 100%;
}
.sensorSearch{
  border: 1px solid rgb(192, 192, 192);
  background-color: #fff;
  width: 100%;
  height: 97%;
}
.dataEchart{
  border: 1px solid rgb(192, 192, 192);
  background-color: #fff;
  width: 100%;
  height: 97%;
  display: inline-block;
}
#chart1{
  width: 90%;
  height: 90%;
  margin-left: 10%;
  display: inline-block;
}
.resize{
  position:absolute;
  right: 15px;
  top: 15px;
  cursor: pointer;
  z-index: 900;
}
.deatileMessageTitle{
  padding: 5px;
}
.deatileTable{
  width: 98%;
  height: 81%;
  position:absolute;
}
.searchInput{
  padding: 5px;
}
.sensorSearchTable{
  width: 98%;
  height: 80%;
  position:absolute;
}
.baiduMap{
  width: 100%;
  height: 100%;
}
.dataSelect{
  padding: 5px;
}
